import React, {useEffect, useState} from "react";
import { motion } from "framer-motion";
import './style.css';

const Main = () => {

    const [contact1Expanded, setContact1Expanded] = useState(false)
    const [contact2Expanded, setContact2Expanded] = useState(false)

    return (
    <div className="container">
        <div className="header-banner">
            <img src='logo.jpg' className="main-logo-img"/>
            <h1>SBC</h1>
        </div>
        <div className="main-slogan-catch-container">
            <h1>Real Estate wholesaling services that work.</h1>
        </div>
        <div className="contact-sect">
            <div className={contactExpanded ? 'contact-card-expanded':'contact-card'} onClick={() => setContact1Expanded(true)}>
                <h2>Contact Van</h2>
            </div>
            <div className={contactExpanded ? 'contact-card-expanded':'contact-card'} onClick={() => setContact2Expanded(true)}>
                <h2>Contact ?</h2>
            </div>
        </div>
    </div>
    );
}

export default Main;
